import React from 'react';
import logo from '../images/logonew.png'
const Header = () => {
    return ( 
        <React.Fragment>
            <div className='logo'>
                <img src={logo}/>
            </div>
            <div className='login-button'>
                <button>Đăng nhập</button>
            </div>
        </React.Fragment>
     );
}
 
export default Header;
